$_MODULE['<{mbeshipping}prestashop>welcome_06acb34650df4917a32a707f41eb0994'] = 'Wysyłka i cyfrowa logistyka z MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_bd279c91483c0fd991bf0dd24082c847'] = 'Nadaj nowy impuls swojemu e-commerce dzięki rozwiązaniom MBE do cyfryzacji przesyłek i logistyki, zaprojektowanym dla firm, przedsiębiorców, ale także rzemieślników, którzy szukają niezawodnego partnera, który może ich wesprzeć, skutecznie wprowadzając swój biznes do sieci dzięki kompletnym i elastycznym rozwiązaniom. Czy jesteś klientem MBE? ';
$_MODULE['<{mbeshipping}prestashop>welcome_02d4482d332e1aef3437cd61c9bcc624'] = 'Skontaktuj się z nami';
$_MODULE['<{mbeshipping}prestashop>welcome_ee3ae8f2b909a448403a77ffbb3cb259'] = 'Rozpocznij konfigurację';
$_MODULE['<{mbeshipping}prestashop>welcome_0d7545e6e62aa27411c09e133edba866'] = 'Łącząc platformę MBE bezpośrednio ze swoim serwisem e-commerce, możesz zautomatyzować zarządzanie przesyłkami i usprawnić proces sprzedaży. ';
$_MODULE['<{mbeshipping}prestashop>welcome_461b35b457d9b9ba7ee9b502c377cc30'] = 'Rozwiązania cyfrowe MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_1bcd51908f4de69964082ee6a92fa697'] = 'Usługi cyfrowe pod klucz, które pomogą Twojej marce wystartować. Docieraj do klientów online dzięki rozwiązaniom cyfrowym i narzędziom marketingu internetowego, które dają większe szanse na dotarcie do odbiorców poprzez budowanie skutecznej obecności online Twojej firmy i bycie tam, gdzie są Twoi klienci. MBE oferuje skuteczne rozwiązania do rozwoju kanałów cyfrowych. Zaprezentuj swoją markę, sklep e-commerce lub ulepsz swoją obecną witrynę, aby była bardziej widoczna w wyszukiwarkach.';
$_MODULE['<{mbeshipping}prestashop>welcome_47e149951cc16a06badb305ea12b2dd5'] = 'MBE Packing	';
$_MODULE['<{mbeshipping}prestashop>welcome_6efcae05527f34189a6799f27c0ae9bd'] = 'Usługa pakowania, która zapewni Twojej firmie przewagę. Twoi klienci zasługują na wyjątkowe doświadczenie: zaskocz ich podczas rozpakowywania spersonalizowanymi rozwiązaniami opakowaniowymi dla Twoich produktów. Wysoce spersonalizowane rozwiązanie, które wzmacnia Twoją markę i dodaje stylu w oparciu o Twoje specyficzne potrzeby. Oprócz optymalizacji czasu i zasobów, możesz zmniejszyć swój wpływ na środowisko, ponieważ MBE wykorzystuje innowacyjne techniki pakowania i materiały.';
$_MODULE['<{mbeshipping}prestashop>welcome_7f59c0ca6fc8f4127ae2692ca2d363a5'] = 'Now you know you have a reliable partner by your side!	';
$_MODULE['<{mbeshipping}prestashop>welcome_eca6d7ebbb683e1d8ae9813c82ca5228'] = 'MBE to właściwy, kompleksowy partner, który wspiera wszystkie realia w przejściu na technologię cyfrową, dostarczając kompletne i gotowe rozwiązania.';
